import React from "react";
import "./News.scss";
export default function News() {
  return (
    <article className="news">
      <div className="news-img">
        <img src="./asset/images/phu-quoc.jpg" className="news-image" />
      </div>
      <h1 className="news-title">
        Những danh lam thắng cảnh của Vịnh Hạ Long được UNESCO công nhận
      </h1>
    </article>
  );
}
